function extractOPS(t){var a=[];return t.forEach(function(t){a.push(t.ops)}),a}function extractNames(t){var a=[];return t.forEach(function(t){a.push(t.name)}),a}function chartData(t,a){return{labels:t,datasets:[{label:dataSetProperties.label,fillColor:dataSetProperties.fillColor,strokeColor:dataSetProperties.strokeColor,highlightFill:dataSetProperties.highlightFill,highlightStroke:dataSetProperties.highlightStroke,data:a}]}}function getOPS(t){$.ajax({url:"/ops_leaders",method:"GET",dataType:"JSON"}).success(function(a){t(a.rankings)})}function opsSuccess(t){var a=extractNames(t),e=extractOPS(t),r=chartData(a,e),o=$("#ops-leader-chart"),l=o[0].getContext("2d");new Chart(l).Bar(r)}var dataSetProperties={label:"Top Ten OPS 2015 MLB Playoffs",fillColor:"rgba(220,220,220,0.5)",strokeColor:"rgba(220,220,220,0.8)",highlightFill:"rgba(220,220,220,0.75)",highlightStroke:"rgba(220,220,220,1)"};$(function(){getOPS(opsSuccess)});